import React from 'react';

const UrlList = ({ urls }) => {
  return (
    <div>
      <h2>URL List</h2>
      {urls.length === 0 ? (
        <p>No URLs to display.</p>
      ) : (
        <ul>
          {urls.map((url) => (
            <li key={url._id}>
              <strong>{url.name}:</strong> {url.url}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default UrlList;
